Series Informaion:
Ben 10: Alien Force is the sequel to the hit Cartoon Network series, Ben 10. The series takes place five years later after the original. Ben no longer wears the Omnitrix, and his cousin, Gwen, has honed her skills in magic. But when an alien invasion of the DNALIENS strike Earth and Grandpa Max goes missing, Ben decides that it&amp;#039;s hero time once again. He&amp;#039;s not alone, as he is joined by Gwen, and even his old archenemy, Kevin Levin comes along for the ride. Now it&amp;#039;s time once again for Ben to begin his quest to find his grandfather and stop the invasion from the evil

Episode Informaion:
Part 1:
Ben discovers that the Forever Knights are trading weapons with the DNAliens, while at the same time, Grandpa Max has mysteriously gone missing. He decides to return the Omnitrix on his wrist and go hero once again.

Part 2:
Ben, Gwen, and Kevin follow a lead that takes them to a secret base in the desert. There they hope to find Grandpa Max but instead find a Highbreed spaceship with a giant cannon. 

